import React from 'react'
import { useState } from 'react'

function Task({task}){
  return( <div
    className="task"
    style={{ textDecoration: task.completed ? "line-through" : "" }}
>
    {task.title}
</div>)
}

const Skill = () => {

  const [list, setList] = useState([
    {
      title: "Grab some Pizza",
      completed: true
  },
  {
      title: "Do your workout",
      completed: true
  },
  {
      title: "Hangout with friends",
      completed: false
  }
  ])

  return (
   <>
   <div className='todo-list'>
    <h1 className='mt-4'>To-D<span style={{color:"orange"}}>o-List</span></h1>

    <div className="card">
      {list.map((list,index)=>(
        <Task list={list}
        index={index}
        key={index}/>
      ))}

    </div>
   </div>
   </>
  )
}

export default Skill
